wasmtime = "0.12.0" Next up let's write the code that we need to execute this wasm file. The simplest version of this looks like so: # extern crate wasmtime;
use std::error::Error;
use wasmtime::*; fn main() -> Result<(), Box<dyn Error>> { // A `Store` is a sort of "global object" in a sense, but for now it suffices // to say that it's generally passed to most constructors. let store = Store::default(); # if false { // We start off by creating a `Module` which represents a compiled form // of our input wasm module. In this case it'll be JIT-compiled after // we parse the text format. let module = Module::from_file(&store, "hello.wat")?;
# }
# let module = Module::new(&store, r#"(module (func (export "answer") (result i32) i32.const 42))"#)?; // After we have a compiled `Module` we can then instantiate it, creating // an `Instance` which we can actually poke at functions on. let instance = Instance::new(&module, &[])?; // The `Instance` gives us access to various exported functions and items, // which we access here to pull out our `answer` exported function and // run it. let answer = instance.get_export("answer") .expect("export named `answer` not found") .func() .expect("export `answer` was not a function"); // There's a few ways we can call the `answer` `Func` value. The easiest // is to statically assert its signature with `get0` (in this case asserting // it takes no arguments and returns one i32) and then call it. let answer = answer.get0::<i32>()?; // And finally we can call our function! Note that the error propagation // with `?` is done to handle the case where the wasm function traps. let result = answer()?; println!("Answer: {:?}", result); Ok(())
} We can build and execute our example with cargo run. Note that by depending on wasmtime you're depending on a JIT compiler, so it may take a moment to build all of its dependencies: $ cargo run Compiling ... ... Finished dev [unoptimized + debuginfo] target(s) in 42.32s Running `wasmtime_hello/target/debug/wasmtime_hello`
Answer: 42 and there we go! We've now executed our first WebAssembly in wasmtime and gotten the result back.

