What we've just seen is a pretty small example of how to call a wasm function and take a look at the result. Most interesting wasm modules, however, are going to import some functions to do something a bit more interesting. For that you'll need to provide imported functions from Rust for wasm to call! Let's take a look at a wasm module which imports a logging function as well as some simple arithmetic from the environment. (module (import "" "log" (func $log (param i32))) (import "" "double" (func $double (param i32) (result i32))) (func (export "run") (result i32) i32.const 0 call $log i32.const 1 call $log i32.const 2 call $double call $log )
) This wasm module will call our "log" import a few times and then also call the "double" import. We can compile and instantiate this module with code that looks like this: # extern crate wasmtime;
# use std::error::Error;
# use wasmtime::*;
# fn main() -> Result<(), Box<dyn Error>> {
# let store = Store::default();
# let module = Module::new(&store, r#"
# (module
# (import "" "log" (func $log (param i32)))
# (import "" "double" (func $double (param i32) (result i32))))"#)?;
// First we can create our `log` function, which will simply print out the
// parameter it receives.
let log = Func::wrap(&store, |param: i32| { println!("log: {}", param);
}); // Next we can create our double function which doubles the input it receives.
let double = Func::wrap(&store, |param: i32| param * 2); // When instantiating the module we now need to provide the imports to the
// instantiation process. This is the second slice argument, where each
// entry in the slice must line up with the imports in the module.
let instance = Instance::new(&module, &[log.into(), double.into()])?;
# Ok(())
# } Note that there's a number of ways to define a Func, be sure to consult its documentation for other ways to create a host-defined function.

