/*
Example of instantiating of the WebAssembly module and invoking its exported
function. You can compile and run this example on Linux with: cargo build --release -p wasmtime cc examples/gcd.c \ -I crates/c-api/include \ -I crates/c-api/wasm-c-api/include \ target/release/libwasmtime.a \ -lpthread -ldl -lm \ -o gcd ./gcd Note that on Windows and macOS the command will be similar, but you'll need
to tweak the `-lpthread` and such annotations.
*/ #include <assert.h>
#include <stdio.h>
#include <stdlib.h>
