function. You can compile and run this example on Linux with: cargo build --release -p wasmtime cc examples/memory.c \ -I crates/c-api/include \ -I crates/c-api/wasm-c-api/include \ target/release/libwasmtime.a \ -lpthread -ldl -lm \ -o memory ./memory Note that on Windows and macOS the command will be similar, but you'll need
