 check(wasm_memory_data(memory)[0x1003] == 4); check_call0(size_func, 2); check_call1(load_func, 0, 0); check_call1(load_func, 0x1000, 1); check_call1(load_func, 0x1003, 4); check_call1(load_func, 0x1ffff, 0); check_trap1(load_func, 0x20000); // Mutate memory. printf("Mutating memory...\n"); wasm_memory_data(memory)[0x1003] = 5; check_ok2(store_func, 0x1002, 6); check_trap2(store_func, 0x20000, 0); check(wasm_memory_data(memory)[0x1002] == 6); check(wasm_memory_data(memory)[0x1003] == 5); check_call1(load_func, 0x1002, 6); check_call1(load_func, 0x1003, 5); // Grow memory. printf("Growing memory...\n"); check(wasm_memory_grow(memory, 1)); check(wasm_memory_size(memory) == 3); check(wasm_memory_data_size(memory) == 0x30000); check_call1(load_func, 0x20000, 0); check_ok2(store_func, 0x20000, 0); check_trap1(load_func, 0x30000); check_trap2(store_func, 0x30000, 0); check(! wasm_memory_grow(memory, 1)); check(wasm_memory_grow(memory, 0)); wasm_extern_vec_delete(&exports); wasm_instance_delete(instance); // Create stand-alone memory. printf("Creating stand-alone memory...\n"); wasm_limits_t limits = {5, 5}; wasm_memorytype_t* memorytype = wasm_memorytype_new(&limits); wasm_memory_t* memory2 = wasm_memory_new(store, memorytype); check(wasm_memory_size(memory2) == 5); check(! wasm_memory_grow(memory2, 1)); check(wasm_memory_grow(memory2, 0)); wasm_memorytype_delete(memorytype); wasm_memory_delete(memory2); // Shut down. printf("Shutting down...\n"); wasm_store_delete(store); wasm_engine_delete(engine); // All done. printf("Done.\n"); return 0;
