First, copy this example WebAssembly text module into your project. It exports a function for calculating the greatest common denominator of two numbers. (module (func $gcd (param i32 i32) (result i32) (local i32) block ;; label = @1 block ;; label = @2 local.get 0 br_if 0 (;@2;) local.get 1 local.set 2 br 1 (;@1;) end loop ;; label = @2 local.get 1 local.get 0 local.tee 2 i32.rem_u local.set 0 local.get 2 local.set 1 local.get 0 br_if 0 (;@2;) end end local.get 2 ) (export "gcd" (func $gcd))
) Before we can do anything with this module, we need to convert it to the WebAssembly binary format. We can do this with the command line tools provided by the WebAssembly binary toolkit wat2wasm gcd.wat This will create the binary form of the gcd module gcd.wasm, we'll use this module in the following steps. Next, install the Wasmtime module loader, which is provided as a python package on PyPi. It can be installed as a dependency through Pip or related tools such as Pipenv. pip install wasmtime Or pipenv install wasmtime After you have Wasmtime installed and you've imported wasmtime, you can import WebAssembly modules in your project like any other python module. import wasmtime
import gcd print("gcd(27, 6) =", gcd.gcd(27, 6)) This script should output gcd(27, 6) = 3 If this is the output you see, congrats! You've successfully ran your first WebAssembly code in python!

