In the first example, we called a function exported by a WebAssembly module. Depeding on what you need to accomplish, WebAssembly modules can also call functions from other modules and python itself. This is done through the module imports mechanism, which allows other modules and the host environment to provide functions, globals, and memory spaces. The following example will show you how to use module imports and work with module linear memory. Note: At the moment, the Wasmtime python module can only import functions and memories. To show how we can use functions from the host, take a look at this rust code extern "C" { fn callback(s: *const u8, s_len: u32) -> u32;
} static MSG: &str = "Hello, world!"; #[no_mangle]
pub extern "C" fn test() { unsafe { callback(MSG.as_ptr(), MSG.len() as u32); }
} We have a test function which calls callback. Since it's wrapped in extern "C", this function will be dynamically linked. The Wasmtime module does this linking automatically by importing any needed modules at runtime. If we compile this example without any extra linker options, the result module will import callback from a module called env, so we need to provide an implementation of callback inside an env.py module. import demo def callback(msg_p: 'i32', msg_len: 'i32') -> 'i32': mv = memoryview(demo.memory) msg = bytes(mv[msg_p:(msg_p + msg_len)]).decode('utf-8') print(msg) return 42 The module provides callback with a pointer to a string message. We use this to index into the demo module's memory, extract the message bytes and print them as a string. Every WebAssembly module exports its main linear memory as "memory" by default, so it's accessible as demo.memory in python. We wrap the memory into a memoryview so we can safely access the values inside. Before we move on, note the type annotations on callback. These are necessary for representing your function as something callable in WebAssembly, since WebAssembly functions only operate on 32 and 64 bit floats and integers. When defining functions for use by WebAssembly modules, make sure the parameters and return value are annotated appropriately as any of 'i32', 'i64', 'f32', or 'f64'. Before we can use demo.rs we need to compile it rustup run nightly rustc --target=wasm32-unknown-unknown --crate-type=cdylib demo.rs We can then use it like this import wasmtime
import demo demo.test() The script should print Hello, world! and exit.
